I created the .vscode folder by hand in VS Code and the settings.json containing: {
    "python.defaultInterpreterPath": "/Users/XXX/.local/share/virtualenvs/storefront-DKUmjWw4"
} PLEASE NOTE:  that it is no longer python.pythonPath but python.defaultInterpreterPath ..

(Edit): I made the folder myself and the settings.json myself and it now works I think.
With the new version of python it told me to put this one instead of the old line just replace "folder" with your path

{
    "python.defaultInterpreterPath": "folder"
}

@Dinushan Paranavithana  I type the line on the bottom and launch the ps1 script again:
Set-ExecutionPolicy -Scope Process -ExecutionPolicy Bypass


by the way, I recommend using cmd, type cmd in windows start and it's a terminal which works without problems. Only debugging won't work, but otherwise I had no errors.

For those in Windows who can't run script at 20:43 , change the value on  .vscode/settings.json from 
{
  "python.pythonPath": "C:\\Path\\To\\.virtualenvs\\storefront-oQQggYtN\\bin\\python"
}

into

{
  "python.pythonPath": "C:\\Path\\To\\.virtualenvs\\storefront-oQQggYtN\\Scripts\\python"
}

Somehow in my case, the binary in my virtualenv is not in bin folder, but in Scripts folder


